import React from 'react';
import { Link } from "react-router-dom";

import "./squareLink.css";

const SquareLink = ({to = "/", color, text = "", children}) => {
    
    return (
        <Link to={to} style={{"backgroundColor": color}} className="square-link" >{children}{text}</Link>
    )
}

export default SquareLink;
